/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';
import Button from 'components/UI/Button/Button';
import { Input } from 'components/UI/Input';
import { FC } from 'react';

interface IAddPageProps {

};

const styles = {
  buttonGoupe: {
    base: css({
      display: 'flex',
      alignItems: 'center',
      gap: '10px'
    })
  }
}

const AddPage: FC<IAddPageProps> = () => {
  return (
    <>
      <div css={styles.buttonGoupe.base}>
        <Button size='medium'>Submit</Button>
        <Button size='medium'>Clean</Button>
      </div>
      <Input sizing='medium' placeholder='hello' withLabel={false} />
    </>
  )
};

export default AddPage;
